(1775, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:50:\"Elementor Expands License To Include Staging Sites\";s:7:\"excerpt\";s:84:\"You can now use Elementor on staging environments without it affecting your license.\";s:7:\"created\";i:1610618136;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:150:\"https://elementor.com/blog/elementor-expands-license-to-include-staging-sites/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:24:\"Elementor Support Update\";s:7:\"excerpt\";s:131:\"In this post, I want to share some of our ongoing measures to upscale our support, as well as the results we are already seeing. \r\n\";s:7:\"created\";i:1610529420;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/support-update-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:81:\"Boosting Conversions With Emotions – Takeaways From Our Webinar With Talia Wolf\";s:7:\"excerpt\";s:164:\"One of the most influential CRO experts shares checklists, key questions to ask, and a step-by-step guide on growing your conversions through emotional targeting. \";s:7:\"created\";i:1610439121;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/webinar-talia-wolf/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:72:\"Elementor Team Writes: How To Create a Draggable Nav Menu With Elementor\";s:7:\"excerpt\";s:204:\"A draggable navigation menu can help you create a visually-engaging experience with its unique effect and also makes it easier for visitors to find content. Let\'s show you how to create one, step by step.\";s:7:\"created\";i:1610368197;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:125:\"https://elementor.com/blog/create-draggable-nav-menu/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:48:\"What Is Flat Design? Origins, Uses, and Examples\";s:7:\"excerpt\";s:159:\"Flat design provides for a great way to enhance conversions, improve loading speeds, and more. Discover what flat design is and how to use it effectively. ​\";s:7:\"created\";i:1609930824;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:111:\"https://elementor.com/blog/flat-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
