(111, 1, '2021-01-07 09:11:06', '2021-01-07 09:11:06', '', 'Son Kem Lì Black Rouge Air Fit Velvet Tint – Hàn Quốc', 'Thương hiệu: Black rouge\r\nXuất xứ: Hàn Quốc\r\nChất son mịn lì, hạn chế tối đa khô môi.\r\nGiữ màu lâu đến 8 tiếng.\r\nĐộ kháng nước cao, không bị trôi khi ăn uống.\r\n\r\nThương hiệu: Black rouge\r\nXuất xứ: Hàn Quốc\r\n\r\nBlack Rouge Air Fit Velvet Tint được ra mắt vào những tháng đầu năm 2018 và đã ngay lập tức tạo được cơn sốt không hề nhỏ trong cộng đồng yêu son. Tiếp nối thành công đó khi mới đây, Black Rouge đã cho tung ra thị trường dòng son Mood Filter, bổ sung vào BST Air Fit Velvet Tint. Vẫn giữ nguyên sự đặc biệt từ chất son, khả năng lên màu và bám tone tốt cùng bảng màu cực kì thời thượng, hứa hẹn sẽ “bùng nổ” thật hoành tráng trong những ngày cuối năm này nhé.', 'publish', 'open', 'closed', '', 'son-kem-li-black-rouge-air-fit-velvet-tint-han-quoc', '', '', '2021-01-12 09:26:23', '2021-01-12 09:26:23', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=111', 0, 'product', '', 0),
(113, 1, '2021-01-07 09:41:40', '2021-01-07 09:41:40', '', 'Son Kem Lì Black Rouge Air Fit Velvet Tint – Hàn Quốc', 'Thương hiệu: Black rouge\nXuất xứ: Hàn Quốc\nChất son mịn lì, hạn chế tối đa khô môi.\nGiữ màu lâu đến 8 tiếng.\nĐộ kháng nước cao, không bị trôi khi ăn uống.\n\nThương hiệu: Black rouge\nXuất xứ: Hàn Quốc\n\nBlack Rouge Air Fit Velvet Tint được ra mắt vào những tháng đầu năm 2018 và đã ngay lập tức tạo được cơn sốt không hề nhỏ trong cộng đồng yêu son. Tiếp nối thành công đó khi mới đây, Black Rouge đã cho tung ra thị trường dòng son Mood Filter, bổ sung vào BST Air Fit Velvet Tint. Vẫn giữ nguyên sự đặc biệt từ chất son, khả năng lên màu và bám tone tốt cùng bảng màu cực kì thời thượng, hứa hẹn sẽ “bùng nổ” thật hoành tráng trong những ngày cuối năm này nhé.', 'inherit', 'closed', 'closed', '', '111-autosave-v1', '', '', '2021-01-07 09:41:40', '2021-01-07 09:41:40', '', 111, 'http://localhost:8082/hncosmetics/2021/01/07/111-autosave-v1/', 0, 'revision', '', 0),
