(202, 1, '2021-01-12 09:32:50', '2021-01-12 09:32:50', '', 'Kẹp Bấm Mi Perfect Diary Bằng Thép Không Gỉ', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n\r\nMàu sắc sản phẩm:  sliver\r\n Mã sản phẩm: 6941311516092\r\n\r\n Thành phần: thép không gỉ\r\n\r\nHướng dẫn sử dụng : \r\n1. Aim the silicone strip holder at the root of the eyelashes and gently apply force. If there is no pain, increase the strength appropriately.\r\n2. The root of the eyelashes first, then the middle, after the order of the end of the side clip gently upward pull, each stay 3-5 seconds after the release.\r\n3. When using the eyelash curler, keep your head and arms fixed and do not do it in a turbulent environment.\r\n\r\nChi tiết:\r\nThương hiệu: Perfect Diary\r\nLoại sản phẩm: Kẹp bấm mi\r\nDành cho: Unisex\r\nChủ đề: Làm đẹp\r\nĐặc điểm: Công cụ làm đẹp cơ bản, Dễ dàng sử dụng \r\nLưu ý: Do not store in hot and sunny places and in places accessible to children.\r\n\r\nGói hàng bao gồm: \r\n1 Kẹp bấm mi bằng thép không gỉ \r\n\r\nLưu ý: Do sự khác biệt giữa các màn hình khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của sản phẩm. Chúng tôi đảm bảo phong cách sản phẩm giống như trong hình. Xin cảm ơn!', 'publish', 'open', 'closed', '', 'kep-bam-mi-perfect-diary-bang-thep-khong-gi', '', '', '2021-01-12 09:32:51', '2021-01-12 09:32:51', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=202', 0, 'product', '', 0),
