(212, 1, '2021-01-12 09:38:17', '2021-01-12 09:38:17', '', 'Mascara nhiều màu sắc kháng nước Zeesea chất lượng cao 3.8g', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n  \r\n  Thiết kế mascara này được lấy cảm hứng từ trí tưởng tượng của công nghệ tương lai, phong cách thiết kế tổng thể có xu hướng đơn giản, và thực sự tỏa sáng. Đầu cọ trang điểm mascara hình lưỡi liềm làm cho trải nghiệm hoàn hảo hơn. Chúng tôi có nhiều màu sắc và đa dạng đầu cọ trang điểm để đáp ứng nhu cầu trang điểm của các dịp khác nhau.\r\n  \r\n  Khoe vẻ đẹp quyến rũ\r\n  Sau khi chải, kéo dài, dày và uốn mi\r\n  Tạo đôi mắt quyến rũ, làm đẹp tự nhiên hơn\r\n  \r\n  1. Dễ dàng trang điểm, lâu và tự nhiên\r\n  2. Không thấm nước và chống nhòe, cảm giác phong phú và trải nghiệm trang điểm \r\n  3. Sự phong phú và rực rỡ, chải nhẹ nhàng, để cho hàng mi đẹp tỏa sáng\r\n  4. Một loạt các màu sắc cho bạn lựa chọn.\r\n  \r\n  Lưu ý:\r\n  Mascara này sử dụng công thức cố định màu và chống thấm dầu. Nên sử dụng nước tẩy trang chuyên dụng.', 'publish', 'open', 'closed', '', 'mascara-nhieu-mau-sac-khang-nuoc-zeesea-chat-luong-cao-3-8g', '', '', '2021-01-12 09:38:17', '2021-01-12 09:38:17', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=212', 0, 'product', '', 0),
