(217, 1, '2021-01-12 09:41:11', '2021-01-12 09:41:11', '', 'Son thỏi ZEESEA nhung mịn chất lượng cao 3.5g', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n  \r\n  ZEESEA 866 \r\n  Màu sắc tinh tế\r\n  Sử dụng quy trình in 3D bức tranh gốc Picasso, bề mặt của son rõ ràng và có kết cấu tốt\r\n  \r\n  1. Kết xuất màu bão hòa cao, công thức màu sắc nổi 3D, màu sắc phong phú, chỉ cần một cái chạm nhẹ, son lên màu bóng đẹp và phong phú\r\n  2. Bột nhuyễn và mịn, kết cấu nhẹ và thoáng khí, không bết dính và duy trì kết cấu nhung mịn trong một thời gian dài.\r\n  3. Công thức giữ màu lâu trôi, công thức trang điểm lâu trôi, giữ màu lâu trôi, không dễ bám bẩn cốc, sảng khoái và không bóng nhờn\r\n \r\n Thành phần: \"octyldodecanol\", \"caprylic/capric triglyceride\", \"Carnauba (COPERNICIA CERIFERA) wax\", \"Candelilla (EUPHORBIA CERIFERA) wax\", \"Beeswax\", \"Diisoharden\" Fatty alcohol malate\", \"bis-diglycerol polyacyl adipate-2\", \"polyglycerol-2 isostearate/dimer linoleate copolymer\", \"hydrogenated castor oil dimer \"Oleate\", \"Propylparaben\", \"Tocopherol (Vitamin E)\",\"CI 15850\",\"CI 45410\",\"CI 77491\",\"CI 77492\",\"CI 77891\"', 'publish', 'open', 'closed', '', 'son-thoi-zeesea-nhung-min-chat-luong-cao-3-5g', '', '', '2021-01-12 09:41:11', '2021-01-12 09:41:11', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=217', 0, 'product', '', 0);
