(222, 1, '2021-01-12 09:43:58', '2021-01-12 09:43:58', '', 'Bảng phấn mắt ZEESEA 9 màu sắc trọng lượng 84g 5.0', 'Bảng phấn mắt ZEESEA 9 màu sắc\r\n\r\nLấy cảm hứng từ câu truyện Alice ở xứ sở thần tiên mới\r\nRơi vào cuộc phiêu lưu ở xứ sở thần tiên với Alice\r\nBảng phấn mắt 9 màu\r\n\r\nSiêu mịn ◆ Siêu bám phấn ◆ Dễ lên màu\r\n1. Kết cấu mịn và bám như sáp\r\n2. Màu sắc cao\r\n3. Thủ công\r\n4. Mềm và mịn\r\n5. Có thể mang theo và trang điểm lâu dài\r\n6. Thiết kế độc đáo\r\n\r\nThành phần:\r\n\"Talc\", \"Mica\", \"Silica\", \"Polymethylmethacrylate\",\"Magnesium Stearate\",\"(Calcium Sodium Borosilicate, CI 77891, Tin Oxide)\",\"Polydimethyl Silicone\",\"CI 77491\",\"Caprylic/Capric Triglyceride\",\"CI 19140\",\"CI 77492\",\"Phenoxyethanol\",\"(Caprylyl glycol, Ethylhexylglycerol)\",\" Tocopherol Acetate\",\"CI 77499\"', 'publish', 'open', 'closed', '', 'bang-phan-mat-zeesea-9-mau-sac-trong-luong-84g-5-0', '', '', '2021-01-12 10:34:53', '2021-01-12 10:34:53', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=222', 0, 'product', '', 1),
