(227, 1, '2021-01-12 09:46:27', '2021-01-12 09:46:27', '', 'Kem lót trang điểm ZEESEA chất lượng cao 20g', ' 01 # Màu tím\r\n  Thích hợp cho: Người có nước da hơi vàng, da xỉn màu và không đều màu.\r\n  \r\n  02 # Màu xanh lá\r\n  Thích hợp cho: Những người có làn da đỏ và có vết mụn.\r\n  \r\n  03 # Tông màu nude\r\n  Thích hợp cho: Da trắng, cần tạo lớp trang điểm tự nhiên\r\n  \r\n  1. Phục hồi làn da và không nhờn, trang điểm mượt mà và mịn màng.\r\n  2. Nâng tông màu da. Màu da có thể được thay đổi tùy theo các vấn đề về tông màu da khác nhau\r\n  3. Dưỡng ẩm cho da, giúp da dịu nhẹ hơn\r\n  \r\n  Thương hiệu: ZEESEA\r\n  Tên sản phẩm: Kem lót trang điểm\r\n  Mỹ phẩm dùng cho mục đích đặt biệt: Không \r\n  Kết cấu sản phẩm: Dạng kem\r\n  Phân loại màu sắc: Tím, xanh lá, tông nude\r\n  Công dụng: Dưỡng ẩm, làm sáng màu da, che khuyết điểm, che khuất lỗ chân lông, bảo vệ lớp trang điểm.\r\n  Loại da thích hợp: Mọi loại da\r\n  Mỹ phẩm dùng cho mục đích đặt biệt: Không \r\n  Xuất xứ: Trung Quốc \r\n  Hạn sử dụng mỹ phẩm: 36 tháng', 'publish', 'open', 'closed', '', 'kem-lot-trang-diem-zeesea-chat-luong-cao-20g', '', '', '2021-01-12 09:46:28', '2021-01-12 09:46:28', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=227', 0, 'product', '', 0),
