(232, 1, '2021-01-12 09:49:28', '2021-01-12 09:49:28', '', 'Son YSL Rouge Pur Couture The Slim_YSL Slim', 'YSL VERNIS À LÈVRES WATER STAIN fresh glossy stain ♥️ là dòng son kem cao cấp với chất son thuộc dạng bán lì mang lại vẻ đẹp thời thượng giàu dưỡng ẩm và làm căn đầy đôi môi cho những cô nàng yêu thích một bờ môi gợi Thiết kế sang trọng với vỏ đỏ để lộ một vạch màu đen của cọ son bên trong sản phẩm, logo thương hiệu YSL khắc trên nắp son tinh xảo đem đến vẻ ngoài cực chất cho dòng son này. Hương thơm cherry nhẹ nhàng sẽ khiến bạn cảm thấy ngọt ngào khi chạm son lên môi, đặc biệt thiết kế đầu son hoàn hảo giúp bạn dễ dàng thoa son và vẽ được viền son sắc nét.\r\nMàu son có độ bắt sáng cao, màu đẹp, bóng mọng môi, cảm giác mát mẻ, thoải mái cả ngày bởi khi apply lên môi rất mỏng, nhẹ. Chính vì vậy khi cần có đôi môi bắt sáng hơn phù hợp với từng sự kiện thì có thể tô nhiều lớp mà không bị ảnh hưởng tới độ đậm nhạt mầu son cũng như làm dầy môi. Tuyệt phẩm đẳng cấp xứng tầm ông lớn và khuấy động ', 'publish', 'open', 'closed', '', 'son-ysl-rouge-pur-couture-the-slim_ysl-slim', '', '', '2021-01-12 09:49:28', '2021-01-12 09:49:28', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=232', 0, 'product', '', 0),
