(237, 1, '2021-01-12 09:51:23', '2021-01-12 09:51:23', '', 'Son môi MAC Powder Kiss Lipstick 3g', 'Đặc điểm nổi bật\r\n- Chất son lì nhưng nhẹ mượt như son dưỡng tạo hiệu ứng mịn lì như bột nhưng lại siêu nhẹ, siêu mỏng cho cảm giác mềm mượt như lụa trên môi.\r\n- Son lên màu ngau lập tức, chuẩn sắc và bền màu trong nhiều giờ liền.\r\n- Son có khả năng làm mịn môi cũng như làm mờ rãnh nhăn trên môi.\r\n- Khi mới thoa, son có độ bóng nhẹ (satin), nhưng sẽ trở nên lì dần, mịn màng, tiệp hẳn da môi.\r\n- Thiết kế hình đặc trưng trứ danh của M.A.C, khác biệt lớn nhất chính là lớp vỏ đen tuyền với bề mặt nhám lì thay vì bóng nhẹ thường thấy. \r\n- Bảng màu khá đa dạng, trải dài từ các gam nude với đủ mọi sắc độ be, hồng cho đến các gam màu tươi tắn, dễ dùng như hồng, đỏ, cam. \r\n', 'publish', 'open', 'closed', '', 'son-moi-mac-powder-kiss-lipstick-3g', '', '', '2021-01-12 09:51:48', '2021-01-12 09:51:48', '', 0, 'http://localhost:8082/hncosmetics/?post_type=product&#038;p=237', 0, 'product', '', 0),
